50115,"facebookEventIdString":"349888535350115","headliners":[{"id":1318543,"name":"CIA","startTime":null,"eventDescription":"CIA consists of Allen Aucoin (drums- The Disco Biscuits, Dr. Fameus), Clay Parnell (bass- Brothers Past, BioDiesel) and Ian McGuire (keyboards- MJ Project, Sonic Spank). Formed in October of 2008, they have quickly earned fans and acclaim as a dynamic and often explosive ensambe playing in the genres of dubstep, house and jungle while sometimes veering into musical territory that defies classification. Built on Aucoin's powerhouse drumming, the engine behind tDB's massive sound, the trio is able to hit strides of high-intensity playing that few other acts playing similar music can match. Add the improvisation and tonal wizardry of Ian McGuire and the "call in the bomb squad" hammer of Parnell's bass and the stage is set for a throw-down, CIA style.","isMobileFriendly":"false","image":{"jumbo":{"path":"http://cdn.ticketfly.com/i/00/02/36/83/56-atjmbo.jpg","width":960,"height":1280},"jumbo1":{"path":"http://cdn.ticketfly.com/i/00/02/36/83/56-atjmbo1.jpg","width":960,"height":540},"large":{"path":"http://cdn.ticketfly.com/i/00/02/36/83/56-atlg.jpg","width":300,"height":400},"large1":{"path":"http://cdn.ticketfly.com/i/00/02/36/83/56-atlg1.jpg","width":300,"height":200},"medium":{"path":"http://cdn.ticketfly.com/i/00/02/36/83/56-atmd.jpg","width":200,"height":267},"medium1":{"path":"http://cdn.ticketfly.com/i/00/02/36/83/56-atmd1.jpg","width":200,"height":133},"original":{"path":"http://cdn.ticketfly.com/i/00/02/36/83/56-og.jpg","width":1536,"height":2048},"small":{"path":"http://cdn.ticketfly.com/i/00/02/36/83/56-atsm.jpg","width":100,"height":133},"small1":{"path":"http://cdn.ticketfly.com/i/00/02/36/83/56-atsm1.jpg","width":100,"height":67},"square":{"path":"http://cdn.ticketfly.com/i/00/02/36/83/56-sq.jpg","width":100,"height":100},"squareSmall":{"path":"http://cdn.ticketfly.com/i/00/02/36/83/56-sqsm.jpg","width":60,"height":60},"xlarge":{"path":"http://cdn.ticketfly.com/i/00/02/36/83/56-atxl.jpg","width":500,"height":666},"xlarge1":{"path":"http://cdn.ticketfly.com/i/00/02/36/83/56-atxl1.jpg","width":500,"height":334},"xxlarge":{"path":"http://cdn.ticketfly.com/i/00/02/36/83/56-atxxl.jpg","width":650,"height":866},"xxlarge1":{"path":"http://cdn.ticketfly.com/i/00/02/36/83/56-atxxl1.jpg","width":650,"height":433}},"youtubeVideos":[],"embedAudio":"","embedVideo":"","urlAudio":"","urlPurchaseMusic":"","urlOfficialWebsite":"http://www.discobiscuits.com","urlMySpace":"","urlFacebook":"https://www.facebook.com/ciamusic?fref=ts","urlTwitter":"","twitterScreenName":""}],"supports":[{"id":1767383,"name":"Telemetry","startTime":null,"eventDescription":"Telemetry is a music duo brought together by the love of creating and performing music. The sound of Telemetry is very dynamic. One moment it can be calm with hypnotic sounds that nestle within your eardrum. The next moment, a heart pumping adrenaline rush. Inspiration is drawn from the love of music and every day life. Their influences range from so many different genres like rock, folk, electronica, jazz, to funk. Anything that is pleasing to the ear.

It all started out of frustration of being in bands that would end as soon as they began by Ian Rasmussen in 2005 while attending school in Los Angeles. A year later Ian moved back to Sacramento where he finished completing Telemetry’s first release “The Lemon Tree EP” in 2008, which is available on iTunes. Eventually Ian would run into ex-band mate Ryan Dearcos from a band they played in when they were younger. After hearing the EP, Ryan asked if Telemetry was playing any shows and Ian told them all they need was a bass player. Not long after that conversation Ryan calls Ian asking if he could try out for bass. After one jam session things were in place.

